{
  "translationLines": [
    {
      "lineNumber": 80341,
      "originalJapaneseLine": "「それで魔軍は総崩れになる筈。",
      "translatedEnglishLine": "\"Then the demon army should completely collapse."
    },
    {
      "lineNumber": 80342,
      "originalJapaneseLine": "　だな、サテラ」",
      "translatedEnglishLine": "Right, Satera.\""
    },
    {
      "lineNumber": 80343,
      "originalJapaneseLine": "「ああ、何度も見てきたように、",
      "translatedEnglishLine": "\"Yeah, as we've seen many times,"
    },
    {
      "lineNumber": 80344,
      "originalJapaneseLine": "　頭を潰された魔軍は弱い。",
      "translatedEnglishLine": "a demon army whose head has been crushed is weak."
    },
    {
      "lineNumber": 80345,
      "originalJapaneseLine": "　ケイブリスを殺せればサテラ達の勝ちだ」",
      "translatedEnglishLine": "If we can kill Caveblis, then it will be Satera's victory.\""
    },
    {
      "lineNumber": 80346,
      "originalJapaneseLine": "「だが、問題はこの戦力では……",
      "translatedEnglishLine": "\"But the problem is that with this fighting force..."
    },
    {
      "lineNumber": 80347,
      "originalJapaneseLine": "　ケイブリスを倒すのは……」",
      "translatedEnglishLine": "defeating Caveblis is...\""
    },
    {
      "lineNumber": 80348,
      "originalJapaneseLine": "「難しいってか？」",
      "translatedEnglishLine": "\"It's difficult, huh?\""
    },
    {
      "lineNumber": 80349,
      "originalJapaneseLine": "「そこをなんとかするから、",
      "translatedEnglishLine": "\"That's what I'll manage somehow,"
    },
    {
      "lineNumber": 80350,
      "originalJapaneseLine": "　俺様は英雄なんだ」",
      "translatedEnglishLine": "because I'm a hero.\""
    },
    {
      "lineNumber": 80351,
      "originalJapaneseLine": "「よし、行くぞ！」",
      "translatedEnglishLine": "\"Alright, let's go!\""
    },
    {
      "lineNumber": 80352,
      "originalJapaneseLine": "「者ども、進軍！",
      "translatedEnglishLine": "\"Men, advance!"
    },
    {
      "lineNumber": 80353,
      "originalJapaneseLine": "　目標、魔軍！」",
      "translatedEnglishLine": "Target: the demon army!\""
    },
    {
      "lineNumber": 80354,
      "originalJapaneseLine": "「これが最後の戦いと思って、",
      "translatedEnglishLine": "\"Think of this as the final battle,"
    },
    {
      "lineNumber": 80355,
      "originalJapaneseLine": "　殺して殺して、殺しまくれ！」",
      "translatedEnglishLine": "kill, kill, and kill without mercy!\""
    },
    {
      "lineNumber": 80356,
      "originalJapaneseLine": "「突撃ィーーーーーー！」",
      "translatedEnglishLine": "\"Chargeeeeeee!\""
    },
    {
      "lineNumber": 80357,
      "originalJapaneseLine": "戦場に、地を揺らすような",
      "translatedEnglishLine": "On the battlefield, a roar from brave warriors shakes the earth."
    },
    {
      "lineNumber": 80358,
      "originalJapaneseLine": "兵-ﾂﾜﾓﾉ-共の鬨の声が響き渡る。",
      "translatedEnglishLine": "The battle cries of the warriors echo resoundingly."
    },
    {
      "lineNumber": 80359,
      "originalJapaneseLine": "「うおおおおお！」",
      "translatedEnglishLine": "\"Uooooooo!\""
    },
    {
      "lineNumber": 80360,
      "originalJapaneseLine": "「ぐ、あっ……」",
      "translatedEnglishLine": "\"Guh, ah...\""
    },
    {
      "lineNumber": 80361,
      "originalJapaneseLine": "祖国を守らんと裂帛な気合いを放つ兵が、",
      "translatedEnglishLine": "Soldiers exuding fierce spirit to protect their homeland"
    },
    {
      "lineNumber": 80362,
      "originalJapaneseLine": "意気も空しく死体となってその場に倒れ伏す。",
      "translatedEnglishLine": "fall down dead ineffectively in that place."
    },
    {
      "lineNumber": 80363,
      "originalJapaneseLine": "そんな『死』は、今この場所に",
      "translatedEnglishLine": "Such 'deaths' were"
    },
    {
      "lineNumber": 80364,
      "originalJapaneseLine": "いくらでも転がっていた。",
      "translatedEnglishLine": "scattered everywhere here and now."
    },
    {
      "lineNumber": 80365,
      "originalJapaneseLine": "「ぎゃははははははは！",
      "translatedEnglishLine": "\"Gyaahahahahahaha!"
    },
    {
      "lineNumber": 80366,
      "originalJapaneseLine": "　人間如きが魔物様に勝てるかよー！」",
      "translatedEnglishLine": "How could mere humans ever win against Lord Monster!\""
    },
    {
      "lineNumber": 80367,
      "originalJapaneseLine": "「あ、が……ぐう……っ」",
      "translatedEnglishLine": "\"Ah, gu... guh...\""
    },
    {
      "lineNumber": 80368,
      "originalJapaneseLine": "そして、その魔物兵もまた、",
      "translatedEnglishLine": "And then, that monster soldier too"
    },
    {
      "lineNumber": 80369,
      "originalJapaneseLine": "数秒もせずに絶命した。",
      "translatedEnglishLine": "died within seconds."
    },
    {
      "lineNumber": 80370,
      "originalJapaneseLine": "「はあ、はあ……はあ、はあ……」",
      "translatedEnglishLine": "\"Hah, hah... hah, hah...\""
    },
    {
      "lineNumber": 80371,
      "originalJapaneseLine": "魔物兵を斬り捨てたランスが",
      "translatedEnglishLine": "Rance, who had cut down the monster soldiers,"
    },
    {
      "lineNumber": 80372,
      "originalJapaneseLine": "上下する肩を落ち着かせる。",
      "translatedEnglishLine": "calmed his rising and falling shoulders."
    },
    {
      "lineNumber": 80373,
      "originalJapaneseLine": "「だー、うっとうしい！",
      "translatedEnglishLine": "\"Damn, so annoying!"
    },
    {
      "lineNumber": 80374,
      "originalJapaneseLine": "　雑魚ばかり倒しても意味ないぞ！」",
      "translatedEnglishLine": "Killing only weaklings is meaningless!\""
    },
    {
      "lineNumber": 80375,
      "originalJapaneseLine": "「ケイブリスはどこだ！",
      "translatedEnglishLine": "\"Where is Caveblis!"
    },
    {
      "lineNumber": 80376,
      "originalJapaneseLine": "　ケイブリスはーーーーー！」",
      "translatedEnglishLine": "Where is Caveblis——!\""
    },
    {
      "lineNumber": 80377,
      "originalJapaneseLine": "「ら、ランス様、大丈夫ですか！？",
      "translatedEnglishLine": "\"L-Lance-sama, are you okay!?"
    },
    {
      "lineNumber": 80378,
      "originalJapaneseLine": "　少しご休憩を……」",
      "translatedEnglishLine": "Please take a little rest...\""
    },
    {
      "lineNumber": 80379,
      "originalJapaneseLine": "「休んでる暇があるか馬鹿もの！」",
      "translatedEnglishLine": "\"Do you think I have time to rest, fool!\""
    },
    {
      "lineNumber": 80380,
      "originalJapaneseLine": "「はあはあ……",
      "translatedEnglishLine": "\"Hah hah..."
    },
    {
      "lineNumber": 80381,
      "originalJapaneseLine": "　とっととブッ殺さなければ……」",
      "translatedEnglishLine": "I have to kill him quickly...\""
    },
    {
      "lineNumber": 80382,
      "originalJapaneseLine": "「い、いた！　ケイブリスだ！",
      "translatedEnglishLine": "\"Th-There! It's Caveblis!"
    },
    {
      "lineNumber": 80383,
      "originalJapaneseLine": "　あいつ、あんなところに――！」",
      "translatedEnglishLine": "He's over there――!\""
    },
    {
      "lineNumber": 80384,
      "originalJapaneseLine": "サテラの指さす先を見れば、",
      "translatedEnglishLine": "Looking where Satera pointed,"
    },
    {
      "lineNumber": 80385,
      "originalJapaneseLine": "確かに前線に立ち兵を率いる",
      "translatedEnglishLine": "there stood Caveblis leading troops at the front line."
    },
    {
      "lineNumber": 80386,
      "originalJapaneseLine": "ケイブリスの姿があった。",
      "translatedEnglishLine": "Caveblis was indeed there."
    },
    {
      "lineNumber": 80387,
      "originalJapaneseLine": "「おお、でかいから目立つな！」",
      "translatedEnglishLine": "\"Oh, he's big so he stands out!\""
    },
    {
      "lineNumber": 80388,
      "originalJapaneseLine": "「行くぞ！」",
      "translatedEnglishLine": "\"Let's go!\""
    },
    {
      "lineNumber": 80389,
      "originalJapaneseLine": "その頃、ケイブリスはイラついていた。",
      "translatedEnglishLine": "Meanwhile, Caveblis was irritated."
    },
    {
      "lineNumber": 80390,
      "originalJapaneseLine": "「進めぇえええええ！",
      "translatedEnglishLine": "\"Advanceeeeeee!\""
    }
  ]
}

